import ExpenseItem from './ExpenseItem';

const ExpensesList = (props) => {
  let expenseContent = <p>No Expenses Data founded</p>;
  if (props.items.filter((expense) => expense.date.getFullYear() == filteredYear).length > 0) {
    expenseContent = props.items
    .filter((expense) => expense.date.getFullYear() == filteredYear)
    .map((expense) => <ExpenseItem 
      key = {expense.id}
      title = {expense.title}
      amount = {expense.amount}
      date = {expense.date}
    ></ExpenseItem>);
  }
}

export default ExpensesList;
